import React , { Component } from 'react';
import titleImage from '../images/image1.png';

class Header extends Component {
    render() {
        const headerStyle = {
            width : '100%' ,
            height: '50px' ,
            background : '#000000',
            boxShadow : '0px 5px',
            clear: 'both'
        }
        const title = {
            margin: 0,
            color : '#ffffff',
            lineHeight : '50px',
            padding : '0 0 0 10%'
        }
        return(
            <div style={headerStyle}>
                <h4 style={title}>김종인의 블로그</h4>
            </div>
        )
    }
}

export default Header;
